import React, { useContext, useState } from 'react';
import { GeneralContext } from '../context/GeneralContext';

const Register = ({ setAuthType }) => {
    const { setUsername: setContextUsername, setEmail, setPassword, register } = useContext(GeneralContext);
    const [username, setUsername] = useState(''); // Rename this variable to something else

    const [email, Email] = useState('');
    const [password, Password] = useState('');
    const [usertype, setUsertype] = useState('');
    const [domain, setDomain] = useState('');
    const [qualification, setQualification] = useState('');

    const handleRegister = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('/register', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    username,
                    email,
                    usertype,
                    password,
                    domain,
                    qualification,
                }),
            });
            const data = await response.json();
            console.log('Server response:', data); // Log server response to browser console

            // Example: Assuming you have a success message in `data.message`
            if (response.ok) {
                console.log('Registration successful:', data.message);
                // Handle success logic (e.g., redirect to login page)
                setAuthType('login'); // Example function to switch to login mode
            } else {
                console.error('Registration failed:', data.message);
                // Handle specific error messages from server
            }
        } catch (error) {
            console.error('Error during registration:', error);
            // Handle network or other errors
        }
    };

    return (
        <form className="authForm">
            <h2>Register</h2>
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="text"
                    className="form-control"
                    id="floatingInput"
                    placeholder="username"
                    onChange={(e) => setUsername(e.target.value)}
                />
                <label htmlFor="floatingInput">Username</label>
            </div>
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="email"
                    className="form-control"
                    id="floatingEmail"
                    placeholder="name@example.com"
                    onChange={(e) => setEmail(e.target.value)}
                />
                <label htmlFor="floatingEmail">Email address</label>
            </div>
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="password"
                    className="form-control"
                    id="floatingPassword"
                    placeholder="Password"
                    onChange={(e) => setPassword(e.target.value)}
                />
                <label htmlFor="floatingPassword">Password</label>
            </div>

            {/* Additional fields for usertype, domain, qualification */}
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="text"
                    className="form-control"
                    id="floatingUsertype"
                    placeholder="User Type"
                    onChange={(e) => setUsertype(e.target.value)}
                />
                <label htmlFor="floatingUsertype">User Type</label>
            </div>
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="text"
                    className="form-control"
                    id="floatingDomain"
                    placeholder="Domain"
                    onChange={(e) => setDomain(e.target.value)}
                />
                <label htmlFor="floatingDomain">Domain</label>
            </div>
            <div className="form-floating mb-3 authFormInputs">
                <input
                    type="text"
                    className="form-control"
                    id="floatingQualification"
                    placeholder="Qualification"
                    onChange={(e) => setQualification(e.target.value)}
                />
                <label htmlFor="floatingQualification">Qualification</label>
            </div>

            <button className="btn btn-primary" onClick={handleRegister}>
                Sign up
            </button>
            <p>
                Already registered? <span onClick={() => setAuthType('login')}>Login</span>
            </p>
        </form>
    );
};

export default Register;
